const car = [
  {
    model: "Duke 200",
    speedStats: { topSpeed: 144, zero_60: 6 },
    colorByPopularity: ["ceramic_White", "Electronic_Orange"],
  },
  {
    model: "Crossfire",
    speedStats: { topSpeed: 140, zeroTo70: 8 },
    colorByPopularity: ["Red", "Balck"],
  },
];

export default car;
